import './App.css';
import Navbar from './components/Navbar';
import Footer from './components/Footer';
import PageRouter from './Router';
import { BrowserRouter as Router, Switch } from 'react-router-dom';

function App() {
  return (
    <>
    <Router>
    <Navbar />
    <Switch>
    <PageRouter />
    </Switch>
    <Footer />
    </Router>
    </>
  );
}

export default App;
